import React from "react";

function Header() {
  return (
    <div class="header">
      <div class="heading">
        <div>
          <h1>Vaccine Finder</h1>
        </div>
        <img class="headinglogo" src="img/vaccine.svg" />
      </div>
      <div class="resources"></div>
    </div>
  );
}

export default Header;
